import { Link } from 'react-router-dom';

function Footer() {
    return (
        <footer className="footer">
            <div className="container">
                <nav className="footer-nav">
                    <a href="#">Help</a>
                    <a href="#">Status</a>
                    <a href="#">About</a>
                    <a href="#">Careers</a>
                    <a href="#">Press</a>
                    <a href="#">Blog</a>
                    <a href="#">Privacy</a>
                    <a href="#">Rules</a>
                    <a href="#">Terms</a>
                    <a href="#">Text to speech</a>
                </nav>
            </div>
        </footer>
    );
}

export default Footer;
